function parseNumberLine(line) {
  return line
    .split(",")          // split by commas
    .map(num => num.trim()) // remove surrounding spaces
    .filter(num => num !== "") // ignore empty entries
    .map(Number);        // convert to actual numbers
}



function sortUniqueDesc(arr) {
  return [...new Set(arr)]      // remove duplicates
    .sort((a, b) => b - a);     // sort high â†’ low
}

function partOne(input) {
    allNumbers = parseNumberLine(input);
    allNumbers = sortUniqueDesc(allNumbers);
    part1 = 0;
    allNumbers.forEach(e => {
        part1 += e;
    });
    return part1;
}

function partTwo(input, numberOfCrates) {
    allNumbers = parseNumberLine(input);
    allNumbers = sortUniqueDesc(allNumbers);
    only20 = [];
    for (let i = allNumbers.length - numberOfCrates; i < allNumbers.length; i++) {
        only20.push(allNumbers[i]);
    }
    part2 = 0;
    only20.forEach(e => {
        part2 += e;
    });
    return part2;
}

function partThree(input) {
    let allNumbers = [];
      function maxFrequencyCount(arr) {
          const counts = new Map();

          for (const num of arr) {
            counts.set(num, (counts.get(num) || 0) + 1);
        }

        let maxCount = 0;

        for (const count of counts.values()) {
            if (count > maxCount) {
              maxCount = count;
          }
      }

      return maxCount;}
      return maxFrequencyCount(input.split(",").map(Number));

}

